<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width,initial-scale=1,minimum-scale=1,maximum-scale=1,user-scalable=no,viewport-fit=cover">
    <title>Doraemon</title>
    <link rel="stylesheet" href="style.fa0d647c.css">
  </head>
  <body>
    <div class="doraemon">
      <div class="mushroom"></div>
      <div class="bamboo"></div>
      <div class="header">
        <div class="face">
          <div class="mustache left">
            <div class="b1"></div>
            <div class="b2"></div>
            <div class="b3"></div>
          </div>
          <div class="mustache right">
            <div class="b1"></div>
            <div class="b2"></div>
            <div class="b3"></div>
          </div>
          <div class="mouth"></div>
        </div>
        <div class="eye left">
          <div class="yuan1"></div>
        </div>
        <div class="eye right">
            <div class="yuan1"></div>
        </div>
        <div class="nose">
          <div class="line"></div>
        </div>
      </div>
      <!-- 身体部分 -->
      <div class="main">
        <div class="abdomen"></div>
        <div class="arm left"></div>
        <div class="arm right"></div>
        <div class="bufanda"></div>
        <div class="baidu"></div>
        <div class="leg left"></div>
        <div class="leg right"></div>
        <div class="cesta"></div>
        <div class="bell"></div>
      </div>
    </div>

    <script src="main.4247b5d9.js"></script>
    <script src="test.40dc94f2.js"></script>
  </body>
</html>
